<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style type="text/css">
        .box {
            width: 300px;
            height: 600px;
            box-sizing: border-box;
            /* background-color: red; */
        }
        
        .content{
            display: flex;
            flex-direction: column;
            justify-content: center;
        }

        a {
            text-decoration: none;
        }

        .content__description{
            width: 300px;
            height: 235px;
            background: rgba(47, 50, 46, 1);
        }

        .content__description-logo{
            width: 121px;
            height: 101px;
            margin: 0 auto;
            margin-top: 17px;
        }

        .content__description-logo img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }
     
        .content__description-title{
            color: white;
            font-size: 20px;
            font-family: "Minion Pro";
            margin: 0;
            text-align: center;
            margin-top: 15px;
        }

        .content__description-subtitle{
            text-align: center;
            margin: 0;
            color: white;
            font-size: 15px;
            font-weight: 400;
            font-family: "Proxima Nova Rg";

        }

        .content__button{
            width: 166px;
            height: 28px;
            margin: 0 auto;
            border: 0.7px solid #FFFFFF;
            font-family: "Proxima Nova Rg";
            color: white;
            font-size: 13px;
            text-align: center;
            padding-top: 3px;
            box-sizing: border-box;
            margin-top: 12px;
        }

        .content__image{
            width: 300px;
            height: 330px;
        }
        .content__image img{
            width: 100%;
            height: 100%;
            object-fit: cover
        }
        
        .footer{
            width: 300px;
            height: 35px;
            background: #123C48;
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 10px;
            box-sizing: border-box;
        }

        .footer__image-1{
            width: 64px;
            height: 20px;
        }

        .footer__image-2{
            width: 104px;
            height: 18px;
        }

        .footer__image-1 img,
        .footer__image-2 img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }
